        lsWinners: queens.filter(queen => week.ls_winner.includes(queen.queen_id)),
        elims: queens.filter(queen => week.elims.includes(queen.queen_id)),
        topThree: queens.filter(queen => week.top_three.includes(queen.queen_id)),
        winner: queens.filter(queen => week.winner.includes(queen.queen_id))
    }

